class Tour extends React.Component{
    constructor(props) {
        super(props);

        this.state = {
        };
    }

    render(){
        const component =
        <Box
            border={{ color: 'brand', size: 'large' }}
            width = "100%"
            height = "medium"
            background = "dark-3"
            round = "large"
        >    
            <InfoPanel />
            <TopActionBar />
            <MiniMap />

        </Box>
        return(component)
    }
}

export default Tour;
